The previously described protocol requires each verifier to generate unique random values, which becomes inefficient when a prover needs to demonstrate knowledge to multiple verifiers. To address this, we aim to eliminate the interaction between the prover and verifier. One effective solution is the use of a trusted setup. Specifically, we let a thrid trusted party generate the secret seeds, which neither the prover nor the verifier can access. However, this prevents the verifier \(\mathcal{B}\) from calculating \(u'^{r}\) to check \(u'^{r} = w'\). Instead, the verifier can use a paring with bilinear mapping; \(u'^{r} = w'\) is equivalent to \(e(u' = (g^{p})^{\delta}, g^{r}) = e(w'=(g^{p'})^{\delta}, g)\). In this tutorial, we adopt the optimal ate pairing, which is an asynmetric pairing and uses two different cyclic groups derived from elliptic curves; \(e(g_1^a, g_2^b) = e(g_1^{ab}, g_2) = e(b_1, g_2^{ab})\), where \(g_1\) and \(g_2\) are the generators of two different cyclic groups. Protocol (Trusted Setup): Secret Seed: A trusted third party generates the random values \(s\) and \(r\) Proof Key: Provided to the prover \(\{\gamma_1, \gamma_2, ..., \gamma_{n}\}\), where \(\gamma_{i} = g_1^{(s^i)}\) \(\{\gamma'_1, \gamma'_2, ..., \gamma'_{n}\}\), where \(\gamma_i' = g_1^{(s^{i})r}\) Verification Key: Distributed to verifiers \(g_2^r\) \(g_2^t := g_2^{T(s)}\) After distribution, the original secret seeds are securely destroyed. Then, the non-interactive protocol consists of two main parts: proof generation and verification. Protocol (Proof): \(\mathcal{A}\) receives the proof key \(\mathcal{A}\) randomly selects \(\delta\) from field \(\mathbb{F}\). \(\mathcal{A}\) broadcast the proof \(\pi = (u' = (g_1^{p})^{\delta}, v' = (g_1^{h})^{\delta}, w' = (g_1^{p'})^{\delta})\) Protocol (Verification): \(\mathcal{B}\) receives the verification key. \(\mathcal{B}\) receives the proof \(\pi\). \(\mathcal{B}\) checks whether \(e(u', g_2^r) = e(w', g_2)\). \(\mathcal{B}\) checks whether \(e(u', g_2) = e (v', g_2^t)\). Implementation: This tutorial utilize elliptic curves called BN128 for pairing: First Group: Curve: \(Y^2 = x^3 + 3\) over the finite field \(\mathbb{F}_{q}\), where \(q\) is defined as 21888242871839275222246405745257275088696311157297823662689037894645226208583. Generator \(\mathscr{g}_1 := (1, 2)\) Second Group: Curve: \(Y^2 = x^3 + 3\) over the finite field \(\mathbb{F} _{q^2}\) Modulus polynomial for \(\mathbb{F} _{q^2}\): \(x^2 + 1\) Generator \(\mathscr{g}_2\) := (11559732032986387107991004021392285783925812861821192530917403151452391805634x + 10857046999023057135944570762232829481370756359578518086990519993285655852781, 4082367875863433681332203403145435568316851327593401208105741076214120093531x + 8495653923123431417604973247489272438418190587263600148770280649306958101930) The orders of two groups are \(\omega := \) 21888242871839275222246405745257275088548364400416034343698204186575808495617. Thus, we evaluate the polynomials over the finite field \(\mathbb{F}_{\omega}\). In the context of elliptic curves, the power of a generator corresponds to the multiplication of an elliptic curve point. This property is reflected in the ate pairing on BN128, which satisfies: \[ e(a \mathscr{g}_1, b \mathscr{g}_2) = e(ab \mathscr{g}_1, \mathscr{g}_2) = e(\mathscr{g}_1, ab\mathscr{g}_2) \] pub struct ProofKey { alpha: Vec<G1Point>, alpha_prime: Vec<G1Point>,
} pub struct VerificationKey { g_r: G2Point, g_t_s: G2Point,
} pub struct Proof { u_prime: G1Point, v_prime: G1Point, w_prime: G1Point,
} pub fn setup( g1: &G1Point, g2: &G2Point, t: &Polynomial<FqOrder>, n: usize,
) -> (ProofKey, VerificationKey) { let s = FqOrder::random_element(&[]); let r = FqOrder::random_element(&[]); let mut alpha = Vec::with_capacity(n); let mut alpha_prime = Vec::with_capacity(n); let mut s_power = FqOrder::one(); for _ in 0..1 + n { alpha.push(g1.mul_ref(s_power.clone().get_value())); alpha_prime.push(g1.mul_ref((s_power.clone() * r.clone()).get_value())); s_power = s_power * s.clone(); } let g_r = g2.mul_ref(r.clone().get_value()); let g_t_s = g2.mul_ref(t.eval(&s).get_value()); ( ProofKey { alpha, alpha_prime }, VerificationKey { g_r, g_t_s }, )
} pub fn prove(p: &Polynomial<FqOrder>, t: &Polynomial<FqOrder>, proof_key: &ProofKey) -> Proof { let h = p.clone() / t.clone(); let delta = FqOrder::random_element(&[]); let g_p = p.eval_with_powers_on_curve(&proof_key.alpha); let g_h = h.eval_with_powers_on_curve(&proof_key.alpha); let g_p_prime = p.eval_with_powers_on_curve(&proof_key.alpha_prime); Proof { u_prime: g_p * delta.get_value(), v_prime: g_h * delta.get_value(), w_prime: g_p_prime * delta.get_value(), }
} pub fn verify(g2: &G2Point, proof: &Proof, vk: &VerificationKey) -> bool { // Check e(u', rG_2) = e(w', G_2) let pairing1 = optimal_ate_pairing(&proof.u_prime, &vk.g_r); let pairing2 = optimal_ate_pairing(&proof.w_prime, g2); let check1 = pairing1 == pairing2; // Check e(u', G_2) = e(v', tG_2) let pairing3 = optimal_ate_pairing(&proof.u_prime, g2); let pairing4 = optimal_ate_pairing(&proof.v_prime, &vk.g_t_s); let check2 = pairing3 == pairing4; check1 && check2
}

