The simplest protocol, based on the previous chapter, is as follows: Protocol (Setup) Interpolated Polynomial: Construct \(\{\ell_i, r_i, o_i\}_{i\in[d]}\) from \(L\), \(R\), and \(O\), respectively. Target Polynomial: \(t(x) = (x-1)(x-2) \cdots (x-m)\) Secret Seed: A trusted party generates the random value \(s\) and \(\alpha\). Proof Key: Provided to the prover \(\{g^{\ell_i(s)},g^{r_i(s)},g^{o_i(s)}\}_{i\in[d]}\) \(\{g^{\alpha \ell_i(s)},g^{\alpha r_i(s)},g^{\alpha o_i(s)}\}_{i\in[d]}\) \(\{g^{(s^j)}\}_{j\in[m]}\) Verification Key: \(g^{t(s)}, g^{\alpha}\) After distribution, the original secret seeds are securely destroyed. Both the proof key and the verification key are publicly available, enabling anyone to generate and verify proofs based on the target program. Protocol (Proving) Run the program to obtain the assignment vector \(v\). Compute the linear-combinations of polynomials \(\ell(x) = \sum_{i=1}^{d} v_i \ell_{i}(x),\quad r(x) = \sum_{i=1}^{d} v_i r_{i}(x),\quad o(x) = \sum_{i=1}^{d} v_i o_{i}(x)\) Compute the quotient polynomial: \(h(x) = \frac{\ell(x) r(x) - o(x)}{t(x)}\) Evaluate each polynomial at \(s\). \(g^{\ell(s)} = \prod^{d}_{i=1} (g^{\ell_i(s)})^{v _i} ,\quad g^{r(s)} = \prod^{d} _{i=1} (g^{r_i(s)})^{v_i} ,\quad g^{o(s)} = \prod^{d} _{i=1} (g^{o _i(s)})^{v _i} \) Evaluate the shifted polynomials at \(s\). \(g^{\alpha \ell(s)} = \prod^{d} _{i=1} (g^{\alpha \ell _i(s)})^{v _i} ,\quad g^{\alpha r(s)} = \prod^{d} _{i=1} (g^{\alpha r _i(s)})^{v _i} ,\quad g^{\alpha o(s)} = \prod^{d} _{i=1} (g^{\alpha o_i(s)})^{v _i} \) Compute \(g^{h(s)}\) from \(\{g^{(s^j)}\}_{j\in[m]}\) Proof : \((g^{\ell(s)}, g^{r(s)}, g^{o(s)}, g^{\alpha \ell(s)}, g^{\alpha r(s)}, g^{\alpha o(s)}, g^{h(s)})\) Protocol (Verification) Parse the proof as \((g^{\ell}, g^r, g^o, g^{\ell'}, g^{r'}, g^{o'}, g^{h})\) Check the polynomial restrictions \(e(g^{\ell}, g^{\alpha}) = e(g^{\ell'}, g),\quad e(g^{r}, g^{\alpha}) = e(g^{r'}, g),\quad e(g^{o}, g^{\alpha}) = e(g^{o'}, g)\) Verify validity of the proof \(e(g^{\ell}, g^{r}) = e(g^t,g^h) \cdot e(g^o, g)\) Implementation #[derive(Debug, Clone)]
pub struct ProofKey1 { g1_ell_i_vec: Vec<G1Point>, g2_r_i_vec: Vec<G2Point>, g1_o_i_vec: Vec<G1Point>, g1_alpha_ell_i_vec: Vec<G1Point>, g2_alpha_r_i_vec: Vec<G2Point>, g1_alpha_o_i_vec: Vec<G1Point>, g1_sj_vec: Vec<G1Point>,
} #[derive(Debug, Clone)]
pub struct VerificationKey1 { g1_alpha: G1Point, g2_alpha: G2Point, g2_t_s: G2Point,
} #[derive(Debug, Clone)]
pub struct Proof1 { g1_ell: G1Point, g2_r: G2Point, g1_o: G1Point, g1_ell_prime: G1Point, g2_r_prime: G2Point, g1_o_prime: G1Point, g1_h: G1Point,
} pub fn setup(g1: &G1Point, g2: &G2Point, qap: &QAP<FqOrder>) -> (ProofKey1, VerificationKey1) { let s = FqOrder::random_element(&[]); let alpha = FqOrder::random_element(&[]); ( ProofKey1 { g1_ell_i_vec: generate_challenge_vec(g1, &qap.ell_i_vec, &s), g2_r_i_vec: generate_challenge_vec(g2, &qap.r_i_vec, &s), g1_o_i_vec: generate_challenge_vec(g1, &qap.o_i_vec, &s), g1_alpha_ell_i_vec: generate_alpha_challenge_vec(g1, &qap.ell_i_vec, &s, &alpha), g2_alpha_r_i_vec: generate_alpha_challenge_vec(g2, &qap.r_i_vec, &s, &alpha), g1_alpha_o_i_vec: generate_alpha_challenge_vec(g1, &qap.o_i_vec, &s, &alpha), g1_sj_vec: generate_s_powers(g1, &s, qap.m), }, VerificationKey1 { g1_alpha: g1 * alpha.get_value(), g2_alpha: g2 * alpha.get_value(), g2_t_s: g2 * qap.t.eval(&s).sanitize().get_value(), }, )
} pub fn prove(assignment: &Vec<FqOrder>, proof_key: &ProofKey1, qap: &QAP<FqOrder>) -> Proof1 { Proof1 { g1_ell: accumulate_curve_points(&proof_key.g1_ell_i_vec, assignment), g2_r: accumulate_curve_points(&proof_key.g2_r_i_vec, assignment), g1_o: accumulate_curve_points(&proof_key.g1_o_i_vec, assignment), g1_ell_prime: accumulate_curve_points(&proof_key.g1_alpha_ell_i_vec, assignment), g2_r_prime: accumulate_curve_points(&proof_key.g2_alpha_r_i_vec, assignment), g1_o_prime: accumulate_curve_points(&proof_key.g1_alpha_o_i_vec, assignment), g1_h: get_h(qap, assignment).eval_with_powers_on_curve(&proof_key.g1_sj_vec), }
} pub fn verify( g1: &G1Point, g2: &G2Point, proof: &Proof1, verification_key: &VerificationKey1,
) -> bool { let pairing1 = optimal_ate_pairing(&proof.g1_ell, &verification_key.g2_alpha); let pairing2 = optimal_ate_pairing(&proof.g1_ell_prime, &g2); if pairing1 != pairing2 { return false; } let pairing3 = optimal_ate_pairing(&verification_key.g1_alpha, &proof.g2_r); let pairing4 = optimal_ate_pairing(&g1, &proof.g2_r_prime); if pairing3 != pairing4 { return false; } let pairing5 = optimal_ate_pairing(&proof.g1_o, &verification_key.g2_alpha); let pairing6 = optimal_ate_pairing(&proof.g1_o_prime, &g2); if pairing5 != pairing6 { return false; } let pairing7 = optimal_ate_pairing(&proof.g1_ell, &proof.g2_r); let pairing8 = optimal_ate_pairing(&proof.g1_h, &verification_key.g2_t_s); let pairing9 = optimal_ate_pairing(&proof.g1_o, &g2); pairing7 == pairing8 * pairing9
} pub fn generate_challenge_vec<F1: Field, F2: Field, E: EllipticCurve>( point: &EllipticCurvePoint<F1, E>, poly_vec: &[Polynomial<F2>], s: &F2,
) -> Vec<EllipticCurvePoint<F1, E>> { poly_vec .iter() .map(|poly| point.mul_ref(poly.eval(s).sanitize().get_value())) .collect()
} pub fn generate_alpha_challenge_vec<F1: Field, F2: Field, E: EllipticCurve>( point: &EllipticCurvePoint<F1, E>, poly_vec: &[Polynomial<F2>], s: &F2, alpha: &F2,
) -> Vec<EllipticCurvePoint<F1, E>> { poly_vec .iter() .map(|poly| point.mul_ref((alpha.mul_ref(&poly.eval(s).sanitize())).get_value())) .collect()
} pub fn generate_s_powers<F1: Field, F2: Field, E: EllipticCurve>( point: &EllipticCurvePoint<F1, E>, s: &F2, m: usize,
) -> Vec<EllipticCurvePoint<F1, E>> { let mut powers = Vec::with_capacity(m + 1); let mut current = F2::one(); for _ in 0..=m { powers.push(point.mul_ref(current.get_value())); current = current * s.clone(); } powers
} pub fn accumulate_curve_points<F1: Field, F2: Field, E: EllipticCurve>( g_vec: &[EllipticCurvePoint<F1, E>], assignment: &[F2],
) -> EllipticCurvePoint<F1, E> { g_vec.iter().zip(assignment.iter()).fold( EllipticCurvePoint::<F1, E>::point_at_infinity(), |acc, (g, &ref a)| acc + g.mul_ref(a.get_value()), )
} pub fn accumulate_polynomials<F: Field>( poly_vec: &[Polynomial<F>], assignment: &[F],
) -> Polynomial<F> { poly_vec .iter() .zip(assignment.iter()) .fold(Polynomial::<F>::zero(), |acc, (poly, &ref a)| { acc + poly.clone() * a.clone() })
} pub fn get_h<F: Field>(qap: &QAP<F>, assignment: &Vec<F>) -> Polynomial<F> { let ell = accumulate_polynomials(&qap.ell_i_vec, assignment); let r = accumulate_polynomials(&qap.r_i_vec, assignment); let o = accumulate_polynomials(&qap.o_i_vec, assignment); (ell * r - o) / qap.t.clone()
} Vulnerability A critical issue with this protocol is that the checks may pass even if \(g^{\ell}\) is computed not from \(\{g^{\ell_i(s)}\}_{i \in [d]}\) but from \(\{g^{r_i(s)}\} _{i \in [d]}\), \(\{g^{o_i(s)}\} _{i \in [d]}\), or their combinations. The same issue applies to \(g^{r}\) and \(g^{o}\). For example, if the prover sends \((g^{\ell(s)}, g^{\ell(s)}, g^{o(s)}, g^{\alpha r(s)}, g^{\alpha \ell(s)}, g^{\alpha o(s)}, g^{h(s)})\) as the proof, all the verification checks still pass, even although the proved statement differs from the original one.

