To address the interchangeability issue, the next protocol uses distinct the different \(\alpha\)-shift for \(\ell\), \(r\), and \(o\). Protocol (Setup) Interpolated Polynomial: Construct \(\{\ell_i, r_i, o_i\}_{i\in[d]}\) from \(L\), \(R\), and \(O\), respectively. Target Polynomial: \(t(x) = (x-1)(x-2) \cdots (x-m)\) Secret Seed: A trusted party generates the random value \(s\), \(\alpha_{\ell}\), \(\alpha_r\), and \(\alpha_o\) . Proof Key (for the prover): \(\{g^{\ell_i(s)},g^{r_i(s)},g^{o_i(s)}\}_{i\in[d]}\) \(\{g^{\alpha_{\ell} \ell_i(s)},g^{\alpha_{r} r_i(s)},g^{\alpha_{o} o_i(s)}\}_{i\in[d]}\) \(\{g^{(s^j)}\}_{j\in[m]}\) Verification Key (public): \(g^{t(s)}\) \(, g^{\alpha_{\ell}},g^{\alpha_{r}},g^{\alpha_{o}}\) After distribution, the original secret seeds are securely destroyed. Protocol (Proving) Execute the program and get the assignment \(v\). Compute the linear-combinations of polynomials \(\ell(x) = \sum_{i=1}^{d} v_i \ell_{i}(x),\quad r(x) = \sum_{i=1}^{d} v_i r_{i}(x),\quad o(x) = \sum_{i=1}^{d} v_i o_{i}(x)\) Compute the quotient polynomial: \(h(x) = \frac{\ell(x) r(x) - o(x)}{t(x)}\) Evaluate each polynomial at \(s\). \(g^{\ell(s)} = \prod^{d}_{i=1} (g^{\ell_i(s)})^{v _i} ,\quad g^{r(s)} = \prod^{d} _{i=1} (g^{r_i(s)})^{v_i} ,\quad g^{o(s)} = \prod^{d} _{i=1} (g^{o _i(s)})^{v _i} \) Evaluate each shifted polynomial at \(s\). \(g^{\alpha_{\ell} \ell(s)} = \prod^{d}_{i=1} (g^{\alpha _{\ell} \ell_i(s)})^{v_i} \) , \(g^{\alpha_{r} r(s)} = \prod^{d}_{i=1} (g^{\alpha _{r} r_i(s)})^{v_i} \) , \(g^{\alpha_{o} o(s)} = \prod^{d}_{i=1} (g^{\alpha _{o} o_i(s)})^{v_i} \) Calculate \(g^{h(s)}\) from \(\{g^{(s^j)}\}_{j\in[m]}\) Proof : \((g^{\ell(s)}, g^{r(s)}, g^{o(s)},\) \(g^{\alpha_{\ell} \ell(s)}, g^{\alpha_{r} r(s)}, g^{\alpha_{o} o(s)},\) \(g^{h(s)})\) Protocol (Verification) Parse proof as \((g^{\ell}, g^r, g^o, g^{\ell'}, g^{r'}, g^{o'}, g^{h})\) Check polynomial restrictions \(e(g^{\ell}, g^{\alpha_{\ell}}) = e(g^{\ell'}, g)\) , \(\quad \) \(e(g^{r}, g^{\alpha_{r}}) = e(g^{r'}, g)\) , \(\quad \) \(e(g^{o}, g^{\alpha_{o}}) = e(g^{o'}, g)\) Validity check \(e(g^{\ell}, g^{r}) = e(g^t,g^h) \cdot e(g^o, g)\) Implementation #[derive(Debug, Clone)]
pub struct ProofKey2 { g1_ell_i_vec: Vec<G1Point>, g2_r_i_vec: Vec<G2Point>, g1_o_i_vec: Vec<G1Point>, g1_alpha_ell_i_vec: Vec<G1Point>, g2_alpha_r_i_vec: Vec<G2Point>, g1_alpha_o_i_vec: Vec<G1Point>, g1_sj_vec: Vec<G1Point>,
} #[derive(Debug, Clone)]
pub struct VerificationKey2 { g2_alpha_ell: G2Point, g1_alpha_r: G1Point, g2_alpha_o: G2Point, g2_t_s: G2Point,
} #[derive(Debug, Clone)]
pub struct Proof2 { g1_ell: G1Point, g2_r: G2Point, g1_o: G1Point, g1_ell_prime: G1Point, g2_r_prime: G2Point, g1_o_prime: G1Point, g1_h: G1Point,
} pub fn setup(g1: &G1Point, g2: &G2Point, qap: &QAP<FqOrder>) -> (ProofKey2, VerificationKey2) { let s = FqOrder::random_element(&[]); let alpha_ell = FqOrder::random_element(&[]); let alpha_r = FqOrder::random_element(&[]); let alpha_o = FqOrder::random_element(&[]); ( ProofKey2 { g1_ell_i_vec: generate_challenge_vec(g1, &qap.ell_i_vec, &s), g2_r_i_vec: generate_challenge_vec(g2, &qap.r_i_vec, &s), g1_o_i_vec: generate_challenge_vec(g1, &qap.o_i_vec, &s), g1_alpha_ell_i_vec: generate_alpha_challenge_vec(g1, &qap.ell_i_vec, &s, &alpha_ell), g2_alpha_r_i_vec: generate_alpha_challenge_vec(g2, &qap.r_i_vec, &s, &alpha_r), g1_alpha_o_i_vec: generate_alpha_challenge_vec(g1, &qap.o_i_vec, &s, &alpha_o), g1_sj_vec: generate_s_powers(g1, &s, qap.m), }, VerificationKey2 { g2_alpha_ell: g2 * alpha_ell.get_value(), g1_alpha_r: g1 * alpha_r.get_value(), g2_alpha_o: g2 * alpha_o.get_value(), g2_t_s: g2 * qap.t.eval(&s).sanitize().get_value(), }, )
} pub fn prove(assignment: &Vec<FqOrder>, proof_key: &ProofKey2, qap: &QAP<FqOrder>) -> Proof2 { Proof2 { g1_ell: accumulate_curve_points(&proof_key.g1_ell_i_vec, assignment), g2_r: accumulate_curve_points(&proof_key.g2_r_i_vec, assignment), g1_o: accumulate_curve_points(&proof_key.g1_o_i_vec, assignment), g1_ell_prime: accumulate_curve_points(&proof_key.g1_alpha_ell_i_vec, assignment), g2_r_prime: accumulate_curve_points(&proof_key.g2_alpha_r_i_vec, assignment), g1_o_prime: accumulate_curve_points(&proof_key.g1_alpha_o_i_vec, assignment), g1_h: get_h(qap, assignment).eval_with_powers_on_curve(&proof_key.g1_sj_vec), }
} pub fn verify( g1: &G1Point, g2: &G2Point, proof: &Proof2, verification_key: &VerificationKey2,
) -> bool { let pairing1 = optimal_ate_pairing(&proof.g1_ell, &verification_key.g2_alpha_ell); let pairing2 = optimal_ate_pairing(&proof.g1_ell_prime, &g2); if pairing1 != pairing2 { return false; } let pairing3 = optimal_ate_pairing(&verification_key.g1_alpha_r, &proof.g2_r); let pairing4 = optimal_ate_pairing(&g1, &proof.g2_r_prime); if pairing3 != pairing4 { return false; } let pairing5 = optimal_ate_pairing(&proof.g1_o, &verification_key.g2_alpha_o); let pairing6 = optimal_ate_pairing(&proof.g1_o_prime, &g2); if pairing5 != pairing6 { return false; } let pairing7 = optimal_ate_pairing(&proof.g1_ell, &proof.g2_r); let pairing8 = optimal_ate_pairing(&proof.g1_h, &verification_key.g2_t_s); let pairing9 = optimal_ate_pairing(&proof.g1_o, &g2); pairing7 == pairing8 * pairing9
} Vulnerability This protocol resolves interchangeability but does not enforce consistency acros \(\ell\), \(r\), and \(o\). Variables \(v_i\) can still take different values in each polynoimal because verification checks are performed separately. pub fn inconsistent_variable_attack( assignment_ell: &Vec<FqOrder>, assignment_r: &Vec<FqOrder>, assignment_o: &Vec<FqOrder>, proof_key: &ProofKey2, qap: &QAP<FqOrder>,
) -> Proof2 { let ell = accumulate_polynomials(&qap.ell_i_vec, assignment_ell); let r = accumulate_polynomials(&qap.r_i_vec, assignment_r); let o = accumulate_polynomials(&qap.o_i_vec, assignment_o); let h = (ell * r - o) / qap.t.clone(); Proof2 { g1_ell: accumulate_curve_points(&proof_key.g1_ell_i_vec, assignment_ell), g2_r: accumulate_curve_points(&proof_key.g2_r_i_vec, assignment_r), g1_o: accumulate_curve_points(&proof_key.g1_o_i_vec, assignment_o), g1_ell_prime: accumulate_curve_points(&proof_key.g1_alpha_ell_i_vec, assignment_ell), g2_r_prime: accumulate_curve_points(&proof_key.g2_alpha_r_i_vec, assignment_r), g1_o_prime: accumulate_curve_points(&proof_key.g1_alpha_o_i_vec, assignment_o), g1_h: h.eval_with_powers_on_curve(&proof_key.g1_sj_vec), }
}

