} pub fn setup(g1: &G1Point, g2: &G2Point, qap: &QAP<FqOrder>) -> (ProofKey3, VerificationKey3) { let s = FqOrder::random_element(&[]); let alpha_ell = FqOrder::random_element(&[]); let alpha_r = FqOrder::random_element(&[]); let alpha_o = FqOrder::random_element(&[]); let beta_ell = FqOrder::random_element(&[]); let beta_r = FqOrder::random_element(&[]); let beta_o = FqOrder::random_element(&[]); let mut g1_checksum_vec = Vec::with_capacity(qap.d); for i in 0..qap.d { let ell_i_s = qap.ell_i_vec[i].eval(&s).sanitize(); let r_i_s = qap.r_i_vec[i].eval(&s).sanitize(); let o_i_s = qap.o_i_vec[i].eval(&s).sanitize(); g1_checksum_vec.push( g1.mul_ref( ((beta_ell.mul_ref(&ell_i_s)) .add_ref(&beta_r.mul_ref(&r_i_s)) .add_ref(&beta_o.mul_ref(&o_i_s))) .get_value(), ), ); } ( ProofKey3 { g1_ell_i_vec: generate_challenge_vec(g1, &qap.ell_i_vec, &s), g2_r_i_vec: generate_challenge_vec(g2, &qap.r_i_vec, &s), g1_o_i_vec: generate_challenge_vec(g1, &qap.o_i_vec, &s), g1_alpha_ell_i_vec: generate_alpha_challenge_vec(g1, &qap.ell_i_vec, &s, &alpha_ell), g2_alpha_r_i_vec: generate_alpha_challenge_vec(g2, &qap.r_i_vec, &s, &alpha_r), g1_alpha_o_i_vec: generate_alpha_challenge_vec(g1, &qap.o_i_vec, &s, &alpha_o), g1_sj_vec: generate_s_powers(g1, &s, qap.m), g1_checksum_vec: g1_checksum_vec, }, VerificationKey3 { g2_alpha_ell: g2 * alpha_ell.get_value(), g1_alpha_r: g1 * alpha_r.get_value(), g2_alpha_o: g2 * alpha_o.get_value(), g2_beta_ell: g2 * beta_ell.get_value(), g1_beta_r: g1 * beta_r.get_value(), g2_beta_o: g2 * beta_o.get_value(), g2_t_s: g2 * qap.t.eval(&s).sanitize().get_value(), }, )
