} pub fn verify( g1: &G1Point, g2: &G2Point, proof: &Proof3, verification_key: &VerificationKey3,
) -> bool { let pairing1 = optimal_ate_pairing(&proof.g1_ell, &verification_key.g2_alpha_ell); let pairing2 = optimal_ate_pairing(&proof.g1_ell_prime, &g2); if pairing1 != pairing2 { return false; } let pairing3 = optimal_ate_pairing(&verification_key.g1_alpha_r, &proof.g2_r); let pairing4 = optimal_ate_pairing(&g1, &proof.g2_r_prime); if pairing3 != pairing4 { return false; } let pairing5 = optimal_ate_pairing(&proof.g1_o, &verification_key.g2_alpha_o); let pairing6 = optimal_ate_pairing(&proof.g1_o_prime, &g2); if pairing5 != pairing6 { return false; } let pairing7 = optimal_ate_pairing(&proof.g1_ell, &proof.g2_r); let pairing8 = optimal_ate_pairing(&proof.g1_h, &verification_key.g2_t_s); let pairing9 = optimal_ate_pairing(&proof.g1_o, &g2); if pairing7 != pairing8 * pairing9 { return false; } let pairing10 = optimal_ate_pairing(&proof.g1_ell, &verification_key.g2_beta_ell); let pairing11 = optimal_ate_pairing(&verification_key.g1_beta_r, &proof.g2_r); let pairing12 = optimal_ate_pairing(&proof.g1_o, &verification_key.g2_beta_o); let pairing13 = optimal_ate_pairing(&proof.g1_z, &g2); pairing10 * pairing11 * pairing12 == pairing13
} Vulnerability Despite these checks, the protocol is vulnerable to malleability . Specifically, a malicious prover can exploit the polynomial restriction check to introduce arbitrary constants, altering the proof witout detection. Recall that the verifier validates whether the submitted \(g^{\ell}\) is actually calculated by \(\{g^{\ell _i(s)}\} _{i \in [d]}\) by checking \(e(g^{\ell}, g^{\alpha _{\ell}}) = e(g^{\ell'}, g)\). However, this process is not sound. Recall that the verification key is publicaly available, and the prover knows both of \(g^{\alpha _{\ell}}\) and \(g^{\beta _{\ell}}\). Here, suppose the prover submits \(g^{\ell} g^{c}\) and \(g^{\ell'} (g^{\alpha _{\ell}})^{c}\) insteads of \(g^{\ell}\) and \(g^{\ell'}\), where \(c\) is a constatn value. Then, the polynomial restriction check still passes: \[ e(g^{\ell} g^{c}, g^{\alpha _{\ell}}) = e(g^{\alpha _{\ell} \ell + \alpha _{\ell} c}, g) = e(g^{\ell'}g^{\alpha _{\ell}c}, g) = e(g^{\ell'} (g^{\alpha _{\ell}})^{c}, g) \] In addition, if the prover submits \(g^{z} (g^{\beta _{\ell}})^{c}\) as the checksum, it also passes the polynomial checksum verification: \[ e(g^{\ell} g^{c}, g^{\beta _{\ell}}) \cdot e(g^{r}, g^{\beta _{r}}) \cdot e(g^{o}, g^{\beta _{o}}) = e(g^{z} (g^{\beta _{\ell}})^{c}, g) \] This phenomenon also can occur for \(r\) and \(o\).

