} impl<M: ModulusValue + 'static, P: IrreduciblePoly<FiniteFieldElement<M>>> Field for ExtendedFieldElement<M, P>
{ fn inverse(&self) -> Self { let mut lm = Polynomial::<FiniteFieldElement<M>>::one(); let mut hm = Polynomial::zero(); let mut low = self.poly.clone(); let mut high = P::modulus().clone(); while !low.is_zero() { let q = &high / &low; let r = &high % &low; let nm = hm - (&lm * &q); high = low; hm = lm; low = r; lm = nm; } Self::new(hm * high.coef[0].inverse()) } fn div_ref(&self, other: &Self) -> Self { self.mul_ref(&other.inverse()) }
}

