} pub struct Verifier4<F: Field> { t: Polynomial<F>, s: F, r: F, g: F,
} impl<F: Field> Prover4<F> { pub fn new(p: Polynomial<F>, t: Polynomial<F>) -> Self { let h = p.clone() / t.clone(); Prover4 { p, t, h } } pub fn compute_values(&self, s_powers: &[F], s_prime_powers: &[F]) -> (F, F, F) { let g_p = self.p.eval_with_powers(s_powers); let g_h = self.h.eval_with_powers(s_powers); let g_p_prime = self.p.eval_with_powers(s_prime_powers); (g_p, g_h, g_p_prime) }
} impl<F: Field> Verifier4<F> { pub fn new(t: Polynomial<F>, generator: i128) -> Self { let s = F::random_element(&[]); let r = F::random_element(&[]); let g = F::from_value(generator); Verifier4 { t, s, r, g } } pub fn generate_challenge(&self, max_degree: usize) -> (Vec<F>, Vec<F>) { let mut s_powers = vec![]; let mut s_prime_powers = vec![]; for i in 0..(max_degree + 1) { s_powers.push( self.g .pow(self.s.clone().pow_m1(i.to_bigint().unwrap()).get_value()), ); s_prime_powers.push(s_powers.last().unwrap().pow(self.r.get_value())); } (s_powers, s_prime_powers) } pub fn verify(&self, u: &F, v: &F, w: &F) -> bool { let t_s = self.t.eval_m1(&self.s); let u_r = u.pow(self.r.clone().get_value()); // Check 1: u^r = w let check1 = u_r == *w; // Check 2: u = v^t let check2 = *u == v.pow(t_s.get_value()); check1 && check2 }
} pub fn knowledge_of_exponent_protocol<F: Field>( prover: &Prover4<F>, verifier: &Verifier4<F>,
) -> bool { // Step 1 & 2: Verifier4 generates a challenge let max_degree = std::cmp::max(prover.p.degree(), prover.h.degree()) as usize; let (s_powers, s_prime_powers) = verifier.generate_challenge(max_degree + 1); // Step 3: Prover4 computes and sends u = g^p, v = g^h, and w = g^p' let (u, v, w) = prover.compute_values(&s_powers, &s_prime_powers); // Step 4 & 5: Verifier4 checks whether u^r = w and u = v^t verifier.verify(&u, &v, &w)
}

